import { SplideSlide } from "@splidejs/react-splide";
import Button from "../../Button";

const Learn_Slide = ({ model, title, subtitle, backgournd }) => {
  return (
    <SplideSlide>
      <section
        className="fullSection"
        style={{ backgroundImage: "url(" + backgournd + ")" }}
      >
        <div className="text-center h-3/5 flex flex-col justify-between">
          <div>
            <h3>{title}</h3>
            <h1>{model}</h1>
            <p>{subtitle}</p>
          </div>
          <Button to="/" label="Order Now" />
        </div>
      </section>
    </SplideSlide>
  );
};

export default Learn_Slide;
